Fixed into the popular imagination of Bram Stoker's classic Dracula, the fascination for the world of the undead remains as strong as ever. Featuring specially commissioned dramatized extracts from the book, this program tells the story of the vampire in legend, fiction and real life. &quot;Vampires&quot; features dramatized 'eyewitness' accounts, extracts from the horror classic &quot;Nosferatu&quot;, plus expert commentary and analysis from Dr. Les Prince of Birmingham University
